window.bookSummaryJSON = "<p>Rough-and-tumble Austin knows better than to flirt with his best friend's younger sister—she's a princess, part-dragon, and 100 percent off-limits—he just can't stop himself.</p> <p>Ryana Blackwood, Princess of the Realms, is coming out of the worst break-up of all time and looking for a rebound. Luckily, her werewolf friend Austin checks all her boxes: he's hot, easy, and nearby.</p> <p>So when Ryana asks him to pretend to show her what a real relationship is like, how on earth is he supposed to resist? But what is he supposed to do when she realizes she's too good for him? And how can she convince him when it's not a game to her anymore?</p> <p><i>Wolf's Princess</i> is a sweet yet incredibly sexy paranormal romance between two complicated people who are fated mates—they just don't know it yet.</p>"; 
